import React from 'react'
import NavbarComponent from "../Components/Navbar_component";
import FileShareComponent from "../Components/FileShareComponent"

const FileShare = () => {
  return (
    <div>
        <NavbarComponent />
        <FileShareComponent />
        
    </div>
  )
}

export default FileShare
